    "2016-05-17T02:47:24.544920",nt"name": "power-supply-adjustment-fuel-charge",nt"isopen":
    false,nt"url": null,nt"notes": "Austin Energyu2019s Power Supply Adjustment
    (PSA) and fuel charge are reviewed annually. Generally, changes to the fuel rate
    are effective on Jan. 1 for the calendar year. Effective FY 2013, the power supply
    adjustment is set as part of the annual budget process. Fuel Charge rates are established
    based on the type of electric service required by a customer and fall into one of
    three levels: secondary, primary or transmission.rnrnPrimary Level Customers - This
    rate is applicable to electric service required by any customer who receives service
    at 12,500 volts (nominal) to 69,000 volts and whose demand for power does not meet
    or exceed 3,000 kilowatts at any interval during the most recent June through September
    billing months as determined by the City of Austin. rnrnSecondary Level Customers
    - This rate is applicable to electric service required by residential customers
    in single-family dwellings, mobile homes, townhouses, or individually metered apartment
    units. It is also applicable to any business that does not receive power at a primary
    or transmission level. Currently, some 30,000 businesses receive the secondary Fuel
    Charge rate.rnrnTransmission Level Customers - This rate is applicable to electric
    service required by any customer who receives service at 69,000 volts (nominal)
    or higher. This rate shall be applied for a minimum of one year. rnrnPrimary and
    transmission voltage level customers (about 90 industrial customers) essentially
    receive power directly from a substation. This results in reduced line losses between
    the point of generation and delivery to the customer. These customers also install
    and maintain their own equipment at their site needed to step down the voltage before
    the power enters their facility. As a result, primary and transmission customers
    pay a slightly lower Fuel Charge.",nt"license_title": "License Not Specified",nt"extras":
